let baseURL = "https://opentdb.com/api.php?amount=10";

const requestActivity = async () => {
    console.log(baseURL)
    let response = await fetch(baseURL);
    let activityData = await response.json();
    return activityData
  }

const App = () => {

    const [num, setNum] = useState(0);
    const [data, setData] = useState("");

    useEffect(() => {

          requestActivity().then(data1 => {
            setData(data1);
          })
        }, [num]);

      return (
          <>
            <p>Components go here</p>
            <div>{setNum(1)}</div>
            <div>{data}</div>
        </>
      )

}



export default App;
